import React from 'react';
import { useAuth } from '../contexts/AuthContext';

const DashboardPage = () => {
  const { user, error, isAuthenticated } = useAuth();

  if (error) {
    return (
      <div style={{ padding: 32, color: 'red' }}>
        <h2>Login Error</h2>
        <p>{error.toString()}</p>
      </div>
    );
  }

  if (!isAuthenticated) {
    return (
      <div style={{ padding: 32 }}>
        <h2>Not logged in</h2>
      </div>
    );
  }

  return (
    <div style={{ padding: 32 }}>
      <h2>You are logged in!</h2>
      <p><strong>Username:</strong> {user?.preferred_username || user?.name || user?.email || 'Unknown'}</p>
      <p><strong>Roles:</strong> {(user?.realm_access?.roles || []).join(', ') || 'None'}</p>
    </div>
  );
};

export default DashboardPage;
